  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains human-use resource
  data for access, airports, archaeological sites, artificial reefs, boat ramps, camping
  sites, Coast Guard stations, ferries, historical sites, marinas, NPS ranger stations,
  recreational beaches, and recreational fishing in Mississippi. Vector points and
  lines in this data set represent human-use site locations. Location specific type
  and source information are stored in relational data tables (described below) designed
  to be used in conjunction with this spatial data layer.This data set comprises a
  portion of the ESI data for Mississippi. ESI data characterize the marine and coastal
  environments and wildlife by their sensitivity to spilled oil. The ESI data include
  information for three main components: shoreline habitats, sensitive biological
  resources, and human-use resources. See also the MGT data layer, part of the larger
  Mississippi ESI database, for additional human-use information.\",\n\t\"owner_org\":
